import React from "react";

const SearchBar = () => (
    <form action="/" method="get">
        <label htmlFor="header-search">
            <span className="visually-hidden">Search Movie List</span>
        </label>
        <input
            type="text"
            id="header-search"
            placeholder="Title"
            name="s" 
        />
        <button type="submit">Search</button>
    </form>
);

export default SearchBar;
